"use strict";(self.webpackChunk_feature_sliced_documentation=self.webpackChunk_feature_sliced_documentation||[]).push([[8857],{7806:function(e){e.exports=JSON.parse('{"blogPosts":[{"id":"international-community","metadata":{"permalink":"/ru/blog/international-community","editUrl":"https://github.com/feature-sliced/documentation/edit/master/blog/blog/2022-07-25-international-community.md","source":"@site/blog/2022-07-25-international-community.md","title":"\ud83c\udf0e FSD international community","description":"FSD international community announcement","date":"2022-07-25T00:00:00.000Z","formattedDate":"25 \u0438\u044e\u043b\u044f 2022 \u0433.","tags":[{"label":"community","permalink":"/ru/blog/tags/community"},{"label":"discord","permalink":"/ru/blog/tags/discord"},{"label":"promo","permalink":"/ru/blog/tags/promo"}],"readingTime":0.705,"truncated":true,"authors":[{"name":"Anton Medvedev","title":"FSD core-team member","url":"https://github.com/unordinarity","image_url":"https://github.com/unordinarity.png","imageURL":"https://github.com/unordinarity.png"}],"nextItem":{"title":"\ud83d\udca5 FSD rebranding!","permalink":"/ru/blog/rebranding-stable"}},"content":"<div class=\\"container text--center margin-vert--md\\">\\n    <img src=\\"/img/blog/international-community.png\\" alt=\\"post-cover\\" width=\\"100%\\" />\\n</div>\\n\\nTLDR: FSD \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0432 \u043c\u0438\u0440, \u0438 \u043d\u0430\u0447\u0430\u043b\u043e\u043c \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0442 \u043c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u044b\u0439 Discord-\u0441\u0435\u0440\u0432\u0435\u0440\\n\\n\x3c!--truncate--\x3e\\n\\n\u041c\u0435\u0442\u043e\u0434\u043e\u043b\u043e\u0433\u0438\u044f FSD \u043f\u0440\u043e\u0448\u043b\u0430 \u0434\u043e\u043b\u0433\u0438\u0439 \u043f\u0443\u0442\u044c \u043e\u0442 Feature-Driven \u0438 Atomic Design \u0434\u043e \u0442\u0435\u043a\u0443\u0449\u0435\u0433\u043e \u0441\u043e\u0441\u0442\u043e\u044f\u043d\u0438\u044f (2.0 \u0432\u0435\u0440\u0441\u0438\u0438). \u041c\u044b, \u0438\u0437\u043d\u0430\u0447\u0430\u043b\u044c\u043d\u044b\u0435 \u0430\u0432\u0442\u043e\u0440\u044b FSD - \u043f\u043e \u0431\u043e\u043b\u044c\u0448\u0435\u0439 \u0447\u0430\u0441\u0442\u0438 \u043d\u043e\u0441\u0438\u0442\u0435\u043b\u0438 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e \u044f\u0437\u044b\u043a\u0430, \u0438 \u043d\u0430\u043c \u0431\u044b\u043b\u043e \u043f\u0440\u043e\u0449\u0435 \u0441\u043e\u0431\u0438\u0440\u0430\u0442\u044c \u0432\u043e\u043a\u0440\u0443\u0433 \u043c\u0435\u0442\u043e\u0434\u043e\u043b\u043e\u0433\u0438\u0438 \u0442\u0430\u043a\u0438\u0445 \u0436\u0435 \u0440\u0443\u0441\u0441\u043a\u043e\u0433\u043e\u0432\u043e\u0440\u044f\u0449\u0438\u0445 Frontend-\u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0447\u0438\u043a\u043e\u0432. \u0425\u0430\u0431\u043e\u043c \u0434\u043b\u044f \u043d\u0430\u0448\u0435\u0433\u043e \u0441\u043e\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u0430 \u0431\u044b\u043b Telegram-\u0447\u0430\u0442, \u0442\u043e\u0436\u0435 \u0440\u0443\u0441\u0441\u043a\u043e\u044f\u0437\u044b\u0447\u043d\u044b\u0439. \u0421\u043e \u0432\u0440\u0435\u043c\u0435\u043d\u0435\u043c \u043e \u043c\u0435\u0442\u043e\u0434\u043e\u043b\u043e\u0433\u0438\u0438 \u0441\u0442\u0430\u043b\u0438 \u0443\u0437\u043d\u0430\u0432\u0430\u0442\u044c \u0440\u0430\u0437\u0440\u0430\u0431\u043e\u0442\u0447\u0438\u043a\u0438 \u0441\u043e \u0432\u0441\u0435\u0433\u043e \u043c\u0438\u0440\u0430, \u0438 \u043c\u044b \u0441\u0442\u043e\u043b\u043a\u043d\u0443\u043b\u0438\u0441\u044c \u0441\u043e \u0441\u043b\u043e\u0436\u043d\u043e\u0441\u0442\u044f\u043c\u0438. \u041f\u0440\u043e\u0441\u0442\u043e\u0433\u043e \u0447\u0430\u0442\u0430 \u043f\u0435\u0440\u0435\u0441\u0442\u0430\u043b\u043e \u0445\u0432\u0430\u0442\u0430\u0442\u044c \u0434\u043b\u044f \u043c\u043d\u043e\u0436\u0435\u0441\u0442\u0432\u0430 \u0441\u0430\u043c\u044b\u0445 \u0440\u0430\u0437\u043d\u044b\u0445 \u043b\u044e\u0434\u0435\u0439, \u043c\u043d\u043e\u0433\u0438\u043c \u0431\u044b\u043b\u043e \u043d\u0435\u043a\u043e\u043c\u0444\u043e\u0440\u0442\u043d\u043e \u043e\u0431\u0449\u0430\u0442\u044c\u0441\u044f \u0432 \u043e\u0434\u043d\u043e\u043c \u043e\u0433\u0440\u043e\u043c\u043d\u043e\u043c \u043f\u0440\u043e\u0441\u0442\u0440\u0430\u043d\u0441\u0442\u0432\u0435. \u041c\u044b \u0440\u0435\u0448\u0438\u043b\u0438, \u0447\u0442\u043e \u044d\u0442\u043e \u0438 \u0435\u0441\u0442\u044c \u0438\u0434\u0435\u0430\u043b\u044c\u043d\u044b\u0439 \u043c\u043e\u043c\u0435\u043d\u0442 \u0440\u0430\u0441\u0448\u0438\u0440\u0438\u0442\u044c \u0441\u043e\u043e\u0431\u0449\u0435\u0441\u0442\u0432\u043e, \u0434\u0430\u0442\u044c \u043a\u0430\u0436\u0434\u043e\u043c\u0443 \u0432\u043e\u0437\u043c\u043e\u0436\u043d\u043e\u0441\u0442\u044c \u0432\u044b\u0441\u043a\u0430\u0437\u0430\u0442\u044c\u0441\u044f, \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e \u043e\u0442 \u043e\u043f\u044b\u0442\u0430 \u0440\u0430\u0431\u043e\u0442\u044b \u0441 FSD, \u043c\u043d\u0435\u043d\u0438\u044f \u043e\u0431 \u0430\u0440\u0445\u0438\u0442\u0435\u043a\u0442\u0443\u0440\u0435 \u041f\u041e, \u043f\u0440\u0435\u0434\u043f\u043e\u0447\u0438\u0442\u0430\u0435\u043c\u043e\u0433\u043e \u0441\u043f\u043e\u0441\u043e\u0431\u0430 \u043e\u0431\u0449\u0435\u043d\u0438\u044f \u0438 \u044f\u0437\u044b\u043a\u0430. \u0422\u0435\u043f\u0435\u0440\u044c \u043e\u0431\u043c\u0435\u043d\u044f\u0442\u044c\u0441\u044f \u043e\u043f\u044b\u0442\u043e\u043c \u0438 \u043c\u043d\u0435\u043d\u0438\u0435\u043c \u043c\u043e\u0436\u043d\u043e \u0432 \u043d\u0430\u0448\u0435\u043c \u0431\u043e\u043b\u044c\u0448\u043e\u043c, \u043d\u043e \u0443\u044e\u0442\u043d\u043e\u043c Discord-\u0441\u0435\u0440\u0432\u0435\u0440\u0435. \u0412\u044b \u043f\u0440\u0438\u0433\u043b\u0430\u0448\u0435\u043d\u044b."},{"id":"rebranding-stable","metadata":{"permalink":"/ru/blog/rebranding-stable","editUrl":"https://github.com/feature-sliced/documentation/edit/master/blog/blog/2022-06-04-rebranding.md","source":"@site/blog/2022-06-04-rebranding.md","title":"\ud83d\udca5 FSD rebranding!","description":"FSD 2.0.0-stable rebranding news \ud83c\udf70","date":"2022-06-04T00:00:00.000Z","formattedDate":"4 \u0438\u044e\u043d\u044f 2022 \u0433.","tags":[{"label":"brand","permalink":"/ru/blog/tags/brand"},{"label":"promo","permalink":"/ru/blog/tags/promo"}],"readingTime":0.95,"truncated":true,"authors":[{"name":"Ilya Azin","title":"FSD core-team member","url":"https://github.com/azinit","image_url":"https://github.com/azinit.png","imageURL":"https://github.com/azinit.png"}],"prevItem":{"title":"\ud83c\udf0e FSD international community","permalink":"/ru/blog/international-community"}},"content":"<div class=\\"container text--center margin-vert--md\\">\\n    <img src=\\"/img/blog/rebranding-stable.png\\" alt=\\"logo-primary\\" width=\\"100%\\" />\\n</div>\\n\\nTLDR: We\'ve made whole new identity for FSD website and all related projects, feel free to use brand assets\\n\\n\x3c!--truncate--\x3e\\n\\nFor a long time FSD had [inconsistent legacy identity](https://drive.google.com/drive/folders/11Y-3qZ_C9jOFoW2UbSp11YasOhw4yBdl?usp=sharing). Old design was not representing core-concepts of methodology because it was created as a pure draft. After long time it should have been actualized. So, for compatible and long-term use of the brand, we carefully rebranded FSD signature style.\\n\\nSo, let\'s take a deep dive and decompose ideas behind redesign. The light glow on new logo resembles warm brightness of old CRT monitors, passing the idea of a long history of software architecture. Geometry slightly refers to legacy logo to maintain continuity. It also subtly provides the idea of vertical layers and clear boundaries between them. Effects and colors are neutral and friendly to seamlessly pervade any page like FSD can do with projects. Lot of ideas, but, like it works with every good design, they may be seamless.\\n\\nLong story short, reworked FSD identity - modern yet vintage, simple yet meaningful, strict yet notable.\\n\\nGet all the assets in [brandbook](/docs/branding)"}]}')}}]);